                        <a className="nav-link active" href="/dashboard" data-bs-toggle="tab" data-bs-target="#nav-home" role="tab" aria-controls="nav-home" aria-selected="true">Dashboard</a>
                        <a className="nav-link" href="/catalog" data-bs-toggle="tab" data-bs-target="#nav-profile" role="tab" aria-controls="nav-profile" aria-selected="false">Catalog</a>
                    </div>
                </nav>
            </div>

